export function teamContentDataSuccess(team) {
    return {
        type: "TEAM_CONTENT_DATA_SUCCESS",
        payload: team
    }
}

export const teamContentData = (url) => dispatch => {
    fetch(url)
        .then(
            response => {
                if (!response.ok) {
                    throw new Error(response.statusText)
                }
                return response
            })
        .then(response => response.json())
        .then(team => dispatch(teamContentDataSuccess(team)))
}
